  false,\n\t\"url\": null,\n\t\"notes\": \"Reson 8101ER multibeam Data were collected
  from 4-23 April 2005 aboard NOAA Survey Launch Acoustic Habitat Investigator (AHI)
  at French Frigate Shoals in Northwestern Hawaiian Islands during cruise AHI-05-01.
  These multibeam data were collected using SAIC ISS-2000 software in the Generic
  Sensor Format and processed using SABER editing software. Sound velocity corrections
  from a Seabird SBE19 CTD sensor and motion corrections from a POS-MV vertical reference
  were applied to the data in real time. Predicted tides were applied to the data
  in real time. Horizontal accuracy is 20m (no differential GPS correctors applied),
  vertical accuracy is depth dependent (~1% of water depth), WGS84 datum. These data
  are not to be used for navigation. Depths mapped range from 10-150m. The AHI was
  deployed from the NOAA Ship Hi'ialakai and concurrent mapping was done using Simrad
  EM300 and EM3002D sonars aboard the ship; metadata for HI-05-01 are submitted separately.\",\n\t\"owner_org\":
